import React from 'react'

function AppointmentDetail(props, {onClose}) {

  const message = props.message;
  const isOpen = props.isOpen;

  if (!isOpen){
    return null
  }
  return (
    <div>
      {/* {message} */}
      Hello
      <button onClick={onClose}>
        Close me!
      </button>
    </div>
  )
}

export default AppointmentDetail
